import React from 'react';

import UserLeaveItem from './UserItem/UserLeaveItem';
import './UserList.css';

const userAttachmentList = props => {
  console.log("user leave list props", props.userAttachment);
  const userAttachment = props.userAttachment.map(leave => {
    return (
      <UserAttachmentItem
        key={leave.type}
        userId={props.authUserId}
        startDate={leave.startDate}
        endDate={leave.endDate}
        description={leave.description}
      />
    );
  });

  return <ul className="userAttachmentList">{userAttachment}</ul>;
};

export default userAttachmentList;
